import React from "react";
import "../../App.css";
import { Card } from "semantic-ui-react";

const ReviewCard = (props) => {
  const review = props.review;

  return (
    <Card centered fluid>
      <Card.Content header>
        <span className="left">
        {review.title}
        </span>
      </Card.Content>
      {/* <Card.Content header>
        {review.rating}
         / 5
      </Card.Content> */}
      <Card.Content description={review.description} />
      <Card.Content extra>
        {review.rating}
         / 5
      </Card.Content>
    </Card>
  );
};

export default ReviewCard;
